import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import InputBase from '@material-ui/core/InputBase';
import Divider from '@material-ui/core/Divider';
import SearchIcon from '@material-ui/icons/Search';
import Grid from '@material-ui/core/Grid';

const searchBarStyles = makeStyles({
	root: {
		padding: '2px 4px',
		display: 'flex',
		alignItems: 'center'
	},
	input: {
		marginLeft: 8,
		flex: 1
	},
	divider: {
		width: 1,
		height: 28,
		margin: 4
	}
});

const gridStyles = {
	paddingTop: '50px'
};

const SearchBar = (props) => {
	const searchBarClasses = searchBarStyles();
	return (
		<Grid container style={gridStyles}>
			<Grid item md={2} xs={1} />
			<Grid item md={8} xs={10}>
				<Paper className={searchBarClasses.root}>
					<div>Select menu</div>
					<Divider className={searchBarClasses.divider} />
					<InputBase className={searchBarClasses.input} placeholder='Search' />
					<SearchIcon />
				</Paper>
			</Grid>
			<Grid item md={2} xs={1} />
		</Grid>
	);
};

export default SearchBar;
